import React, { Component } from 'react'
import Video from './Video'

export class VideoList extends Component {
    render() {
        return (
            <div>
                {this.props.videos.map(video =>{
                    return <Video key={video.etag} video={video}/>
                })}
            </div>
        )
    }
}

export default VideoList
